import React from 'react';
import logo from './logo.svg';
import './App.css';

import firebase from './firebase'

firebase.firestore().collection('times').add({title:"test", time_seconds: 45})

function App() {
  return (
    <div className="App">
      <h1> Test Sending/Recieving </h1>
    </div>
  );
}

export default App;
